package com.hdsx.ao.bean;

import java.io.Serializable;

// TODO: Auto-generated Javadoc
/**
 * The Class XlsColumn.
 */
public class XlsColumn implements Serializable{

	/** The Constant serialVersionUID. */
	private static final long serialVersionUID = 1L;
	
	/** 单元格编码. */
	private String cellCode;
	
	/** 单元格名称. */
	private String cellName;
	
	/** 对应实体属性. */
	private String field;
	
	/** 单元格类型. */
	private CellType cellType;
	
	/**
	 * Gets the cell type.
	 *
	 * @return the cell type
	 */
	public CellType getCellType() {
		return cellType;
	}

	/**
	 * Sets the cell type.
	 *
	 * @param cellType the new cell type
	 */
	public void setCellType(CellType cellType) {
		this.cellType = cellType;
	}

	/**
	 * Gets the cell code.
	 *
	 * @return the cell code
	 */
	public String getCellCode() {
		return cellCode;
	}
	
	/**
	 * Sets the cell code.
	 *
	 * @param cellCode the new cell code
	 */
	public void setCellCode(String cellCode) {
		this.cellCode = cellCode;
	}
	
	/**
	 * Gets the cell name.
	 *
	 * @return the cell name
	 */
	public String getCellName() {
		return cellName;
	}
	
	/**
	 * Sets the cell name.
	 *
	 * @param cellName the new cell name
	 */
	public void setCellName(String cellName) {
		this.cellName = cellName;
	}
	
	/**
	 * Gets the field.
	 *
	 * @return the field
	 */
	public String getField() {
		return field;
	}
	
	/**
	 * Sets the field.
	 *
	 * @param field the new field
	 */
	public void setField(String field) {
		this.field = field;
	}
	
	/**
	 * Instantiates a new xls column.
	 */
	public XlsColumn(){}
	
	/**
	 * Instantiates a new xls column.
	 *
	 * @param cellCode the cell code
	 * @param cellName the cell name
	 * @param field the field
	 */
	public XlsColumn(String cellCode, String cellName, String field) {
		super();
		this.cellCode = cellCode;
		this.cellName = cellName;
		this.field = field;
	}
	
	/* (non-Javadoc)
	 * @see java.lang.Object#toString()
	 */
	@Override
	public String toString() {
		return "XlsColumn [cellCode=" + cellCode + ", cellName=" + cellName
				+ ", field=" + field + "]";
	}
	
}
